import React from "react";
import { useNavigate } from "react-router-dom";
import { 
  Container, 
  Typography, 
  Box, 
  Paper,
  Button
} from '@mui/material';
import { styled } from '@mui/material/styles';

// Styled components using MUI's styled API
const StyledPaper = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(4),
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  gap: theme.spacing(3),
  maxWidth: 600,
  margin: '0 auto',
  marginTop: theme.spacing(4),
  backgroundColor: '#fff',
  boxShadow: '0 3px 5px 2px rgba(0, 0, 0, 0.1)',
}));

const WelcomeBox = styled(Box)(({ theme }) => ({
  textAlign: 'center',
  marginBottom: theme.spacing(4),
}));

function HomePage() {
  const navigate = useNavigate();
  const tenantId = 1; // Set default tenantId to 1

  const handleOrganisationsClick = () => {
    navigate('/organisations', { state: { tenantId } });
  };

  return (
    <div className={styles.container}>
      <h1>Welcome to Requirements Tracker</h1>
      <p>Select an option from the menu to get started.</p>
      {/* You can also add a direct button to navigate to organisations if needed */}
      <button onClick={handleOrganisationsClick}>View Organisations</button>
    </div>
  );
}

export default HomePage;
